export default function Table() {
    const data_lists = [1,3,4,5,8,10,60];
    let i=0;
    return (
        <div>
            <table className="table table-striped">
        <thead>
          <tr>
            <th>ลำดับ</th>
            <th>ข้อมูล</th>
            
          </tr>
        </thead>
        <tbody>
          {data_lists.map((item) => {
              
            return (
              <tr>
                <td>{item}</td>
                
              </tr>
            );
          })}
        </tbody>
      </table>
        </div>
    )
}
